import React from "react";
import 'react-bulma-components/dist/react-bulma-components.min.css';
import { Navbar, Hero, Container } from 'react-bulma-components';
// import NavBar from "./components/NavBar";


class App extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <>
                <Navbar transparent={true}>
                    <Navbar.Brand>

                    </Navbar.Brand>
                    <Navbar.Menu>
                        <Navbar.Item href="#">
                            Skills
                </Navbar.Item>
                        <Navbar.Item href="#">
                            Projects
                </Navbar.Item>
                        <Navbar.Item href="#">
                            Contact
                    </Navbar.Item>
                    </Navbar.Menu>
                </Navbar>
                <Hero fullheight="true" is-white>
                    <Hero.Body>
                        <Container>Hola</Container>

                    </Hero.Body>
                </Hero>
            </>
        );
    }
}

export default App;
